import { useState } from "react"

export const NewCorp=()=>{
    const[times,setTimes]=useState(0)
    return(
        <>
            <button className="btn btn-outline-danger" onClick={()=>{
                setTimes(times+1)
            }} onDoubleClick={()=>{
                setTimes(0)
            }}>
                Clicked Count is {times}
            </button>

            {(times)}
        </>
    )
}
